import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/VisualizarClientes.css";

const clientes = [
  { id: 1, nome: "João Silva", email: "joao.silva@gmail.com", dataNascimento: "01/01/2000", contato: "83999999999", endereco: { pais: "Brasil", estado: "Paraíba", cidade: "Sousa" } },
  { id: 2, nome: "Maria Oliveira", email: "maria.oliveira@gmail.com", dataNascimento: "08/05/1985", contato: "83988888888", endereco: { pais: "Brasil", estado: "São Paulo", cidade: "São Paulo" } },
  { id: 3, nome: "Joaquim Sousa", email: "joaquim.sousa@gmail.com", dataNascimento: "02/06/2003", contato: "83977777777", endereco: { pais: "Brasil", estado: "Rio de Janeiro", cidade: "Rio de Janeiro" } },
  { id: 4, nome: "Antonio Araújo", email: "antonio.araujo@gmail.com", dataNascimento: "30/05/2003", contato: "83966666666", endereco: { pais: "Brasil", estado: "Bahia", cidade: "Salvador" } },
];

const VisualizarClientes = () => {
  const navigate = useNavigate();

  const handleClienteClick = (clienteId) => {
    navigate(`/cliente/${clienteId}`);
  };

  return (
    <div className="visualizar-clientes">
      <header className="header">
        <h1>Visualizar Clientes</h1>
      </header>
      <div className="clientes-lista">
        {clientes.map((cliente) => (
          <div
            key={cliente.id}
            className="cliente-card"
            onClick={() => handleClienteClick(cliente.id)}
          >
            <p><strong>Nome</strong>: {cliente.nome}</p>
            <p><strong>Data de Nascimento</strong>: {cliente.dataNascimento}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default VisualizarClientes;
